\begin{abstract}
Total cross sections for the $pp \rightarrow pp\eta^{\prime}$ reaction
have been measured in the excess energy range from Q~=~1.53~MeV to 
Q~=~23.64~MeV.
The experiment has been performed at the internal installation COSY~-~11~\protect\cite{brau96}
using a stochastically cooled proton beam of the COoler  SYnchrotron COSY~\protect\cite{maie97}
and a hydrogen cluster target~\protect\cite{domb97,khou96}.
